                                            '新华时评丨让文明对话照亮携手前行之路 - '
                                            '中国军网\\n\\n新华时评丨让文明对话照亮携手前行之路\\n\\n6月10日，世界迎来首个文明对话国际日。\\n连日来，国际社会举办丰富多彩的庆祝活动，以此为契机促进全球文明交流互鉴，在文明对话中携手应对时代挑战，促进世界和平、增进人类福祉、推动发展与进步。\\n联合国秘书长古特雷斯在视频致辞中说，值此首个文明对话国际日之际，国际社会应弘扬对话是通往和平的途径这一信念，以及文明的丰富多样性对于促进相互理解和全球团结的力量。\\n在纽约联合国总部，以“推动文明交流互鉴 '
                                            '加强国际团结合作”为主题的对话会吸引多国代表积极参与；在丹麦，“对话·知音”讲座音乐会以音乐为纽带，诠释“美美与共”的共同价值；在泰国，“和合文明论坛”旨在通过多元文明的深度对话与思想碰撞，凝聚起应对时代挑战的广泛共识；在毛里求斯，“茶和天下·文明对话雅集”活动展现茶在促进东西方文明交流、理解和互鉴方面扮演的重要角色；在希腊，中外专家学者围绕“古文明对话促进全球进步”主题展开深入讨论……正如联合国在其设立的文明对话国际日专题网页上所写道：文明对话国际日提供了一个契机，提升人们对文明多样性价值的认识，促进对话、相互尊重和全球团结，推动建设一个更加和谐、相互联结的世界。\\n放眼全球，世界经济复苏道阻且长、局部冲突和动荡频发、气候变化加剧等全球性挑战日益严峻，文明冲突的论调甚嚣尘上。\\n站在历史的十字路口，人类文明该何去何从？\\n面对世界百年变局带来的巨大冲击，文明的价值空前凸显，文明的互动至关重要，文明的对话正当其时。\\n2023年3月，习近平主席提出全球文明倡议，着眼推动不同文明交流互鉴、增进各国人民相知相亲、凝聚国际社会合作共识、促进人类文明发展进步，得到联合国和国际社会的积极响应。\\n联大关于设立文明对话国际日的决议充分体现全球文明倡议的核心要义，14个国家参加决议核心小组，83个国家参加联署，并得到全体会员国一致支持。\\n这充分表明全球文明倡议顺应时代潮流、契合时代需求，中国理念和中国方案正越来越多地成为国际共识。\\n中国是文明对话国际日的倡议者，更是文明互学互鉴理念的践行者。\\n举办亚洲文明对话大会、中国共产党与世界政党高层对话会、文明交流互鉴对话会、“良渚论坛”，为不同文明搭建交流对话平台；不断扩大免签“朋友圈”，促进中外人员在交流往来中领略不同文明的魅力；举办中外旅游年、文化节、青年艺术节，建设中希文明互鉴中心、中匈文明交流互鉴合作研究中心、中国古典文明研究院，架起交流互鉴、相知相近的桥梁；在中拉论坛第四届部长级会议期间，中拉宣布携手启动文明工程，举办中拉文明对话大会，加强在联合考古、古迹保护等文化遗产领域交流合作，开展古代文明研究；在中非合作论坛北京峰会，中非宣布开展携手推进现代化的文明互鉴伙伴行动，打造治国理政经验交流平台，设立中非发展知识网络……从双边到多边、从区域到全球，新时代中国致力于推动不同文明交流互鉴，重视文明传承和创新，增进各国人民相知相亲，倡导弘扬全人类共同价值，不断拓展国际人文交流合作的深度广度，彰显“为人类谋进步、为世界谋大同”的使命担当。\\n中国以博大的人文情怀观照人类命运，以和合共生的愿景凝聚发展合力，以兼容并蓄的胸襟超越隔阂冲突，为建设一个持久和平、共同繁荣的大同世界持续贡献力量。\\n坦桑尼亚达累斯萨拉姆大学中国研究中心主任汉弗莱·莫西说，中国在推动不同文明之间平等对话方面发挥了非常重要的作用，“中国强调每种文明都有其独特价值和存在合理性，应该相互尊重、互学互鉴，这一理念契合了当今国际社会推动多元共存、包容发展的普遍共识”。\\n一部人类文明史，也是一部多元文明共生并进的历史。\\n在全球化深入发展、各国命运紧密相连的今天，面对层出不穷的全球性挑战，面对各国人民对美好生活的共同追求，我们只有秉持开放包容精神加强文明对话，方能在交流互鉴中融合不同文明的优点和智慧，促进各国优秀传统文化在现代化进程中实现创造性转化和创新性发展，共同推动人类社会现代化进程、繁荣世界文明百花园。\\n（新华社北京6月10日电）"\n'
