                                            '中国军网\\n\\n2025年6月9日外交部发言人林剑主持例行记者会\\n\\n中新社记者：据了解，东亚合作系列高官会即将在马来西亚举行。\\n发言人能否介绍中方的出席情况及对会议的期待？\\n林剑：东盟轮值主席国马来西亚将于6月10日至11日在槟城举行东盟与中日韩（10＋3）高官会、东亚峰会（EAS）高官会和东盟地区论坛（ARF）高官会。\\n中国外交部副部长孙卫东将率团出席。\\n会议期间，各方将围绕“包容性和可持续性”主题，就推进各机制合作及共同关心的国际和地区问题交换意见，为今年东亚合作领导人系列会议和外长会预作准备。\\n中方期待同与会各方深入交流，进一步凝聚共识、聚焦合作，为地区发展注入更多稳定性和正能量。\\n路透社记者：何立峰副总理和美国高级官员今天将在伦敦举行会议。\\n发言人能否提供更多信息？\\n中方重点关注哪些议题，对会议有何期待或希望取得什么成果？\\n林剑：中方已经发布了中美经贸磋商机制首次会议有关消息。\\n关于磋商的具体情况，请你保持关注。\\n共同社记者：日本政府证实中国航母辽宁舰在日本附近的太平洋海域活动。\\n中方对此有何回应？\\n林剑：中国军舰在有关海域活动完全符合国际法和国际惯例。\\n中国一贯奉行防御性国防政策，希望日方客观理性看待。\\n法新社记者：《纽约时报》上周六发表文章称，该报获悉的俄罗斯联邦安全局内部规划文件显示，中国对俄安全构成威胁，并称中方正试图获取俄敏感军事技术。\\n外交部对此有何评论？\\n林剑：我不了解你说的情况。\\n我要强调的是，中俄关系不针对第三方，也不受第三方影响。\\n路透社记者：中国政府周六表示，愿意通过“绿色通道”加快稀土磁铁对欧洲出口的审批程序。\\n中方是否计划向其他国家或地区开放“绿色通道”？\\n是否会向美方开通类似渠道？\\n林剑：中国商务部已就中国稀土出口管制措施作出回应，你可以查阅。\\n关于你提到的具体情况，请向中方主管部门询问。"\n'
